import {
  ChapterData,
  IsoControlApiModel,
  IsoStandart,
  mapNestedKeys,
  MitreEnterpriseApiModel,
  Nis2Requirements,
  Nis2ToMmSepAndBu,
  NistControlApiModel,
  SepModel,
  TaGroupAndCategory,
} from "../components/maturity-model/Data";
import { IRepository } from "./repository-interface";

export class TestRepository implements IRepository {
  async getNis2ToSepTable(): Promise<Nis2ToMmSepAndBu[]> {
    return nis2ToMmSepAndBu.map((x) =>
      mapNestedKeys(x, ["esa_date"])
    ) as Nis2ToMmSepAndBu[];
  }
  async getNis2Requirements(): Promise<Nis2Requirements[]> {
    return new Promise ((resolve) => setTimeout(() => resolve(nis2Requirements.map((x) => mapNestedKeys(x))), 0))
    
  }

  async getMitreTechniques(
    maturityGuid: string
  ): Promise<MitreEnterpriseApiModel[]> {
    return MitreTechniques.map((x) => mapNestedKeys(x));
  }
  async getNistControls(maturityGuid: string): Promise<NistControlApiModel[]> {
    return NistControls.map((x) => mapNestedKeys(x));
  }
  async getIsoStandart(maturityGuid: string): Promise<IsoControlApiModel[]> {
    return IsoStandarts.map((x) => mapNestedKeys(x));
  }
  async getActorGroupAndCategory(): Promise<TaGroupAndCategory[]> {
    return taGroupAndCategory.map((x) => mapNestedKeys(x));
  }
  async getChapterData(): Promise<ChapterData[]> {
    return chapterData.map((x) => mapNestedKeys(x));
  }
  async getMaturityModel(): Promise<SepModel[]> {
    return maturityModelData.map((x) =>
      mapNestedKeys(x, ["esa_date"])
    ) as SepModel[];
  }
}

